function get_wins_and_real_name() {
	let winsArray = episode_outcomes.filter(queen => queen.outcome ==="WIN");

 
	var html = "<table border='1|1'><tr><td align=center><b>Season</b></td><td align=center><b>Episode</b></td><td align=center><b>Episode Type</b></td><td  align=center><b>Contestant</b></td></tr>";
	for (var i = 0; i < winsArray.length; i++) {
		html+="<tr>";
		html+="<td align=center>"+winsArray[i].season+"</td>";
		html+="<td align=center>"+winsArray[i].episode+"</td>";
		html+="<td align=center>"+winsArray[i].episode_type+"</td>";
 		var cross_find = winsArray[i].contestant_id;
		let cross_find_data = contestant_data.filter(name => name.contestant_id ===cross_find);
		 let cross_find_name = cross_find_data[0].real_name;
		html+="<td align=center>"+winsArray[i].contestant+"<br>" + cross_find_name + "</td>";
		//html+="<td align=center>"+winsArray[i].outcome+"</td>";
		html+="</tr>";

	}
	html+="</table>";
	document.getElementById("results_here").innerHTML = html;

    return false;
}
